package fr.creasport.webgestionstock.metier;

public class TypeExpedition {
	private int te_id;
	private String te_code;
	private String te_nom;
	
	public TypeExpedition() {
		// TODO Auto-generated constructor stub
	}

	public int getTe_id() {
		return te_id;
	}

	public void setTe_id(int te_id) {
		this.te_id = te_id;
	}

	public String getTe_code() {
		return te_code;
	}

	public void setTe_code(String te_code) {
		this.te_code = te_code;
	}

	public String getTe_nom() {
		return te_nom;
	}

	public void setTe_nom(String te_nom) {
		this.te_nom = te_nom;
	}

}
